gCq(){return"Sobre m\xed"},
gCp(){return"\ud83d\udc4b Hola, soy @jnahuel-developer\n\nSoy Ingeniero Electr\xf3nico con amplia experiencia en dise\xf1o de software y hardware. Me gradu\xe9 en la UTN-BA en 2017, y desde entonces acumulo m\xe1s de seis a\xf1os trabajando en proyectos de ingenier\xeda diversos.\n\n\ud83d\ude80 Sobre m\xed\n\n\ud83d\udd39 Experiencia en sistemas ISO: he dise\xf1ado sistemas cumpliendo normas ISO 13485 (dispositivos m\xe9dicos) e ISO 8583 (transacciones financieras).\n\n\ud83d\udd39 Optimizaci\xf3n de costos y fabricaci\xf3n: lider\xe9 iniciativas para reducir costos de producci\xf3n, reemplazando componentes obsoletos y estableciendo nuevos proveedores de PCBs en China, mejorando eficiencia y calidad.\n\n\ud83d\udcbb Desarrollo de software\n\nDominio de C.\nConocimientos avanzados de C++, C# y MATLAB.\nConocimientos b\xe1sicos de Python, HTML, CSS y JavaScript.\nExperiencia con bases de datos relacionales como MySQL.\nDesarrollo de apps m\xf3viles multiplataforma con Flutter, integrando Firebase y Dropbox API.\n\n\ud83d\udd29 Dise\xf1o de hardware\n\nExperiencia con Altium Designer para dise\xf1o de PCBs.\nDesarrollo de librer\xedas personalizadas: integraci\xf3n de modelos 3D y referencias actualizadas de componentes.\nModelado 3D de PCBs completas: facilitando interacci\xf3n con equipos de mec\xe1nica.\nGesti\xf3n de listas de materiales (BOM): actualizando BOMs para asistir al \xe1rea de compras.\n\n\ud83c\udfaf Intereses\n\nMe apasionan tanto los desaf\xedos de hardware como de software. Disfruto resolver problemas complejos, desde firmware hasta aplicaciones full-stack.\n\n\ud83c\udf31 Actualmente aprendiendo\n\nEstoy expandiendo mis habilidades, enfoc\xe1ndome en:\n\nDesarrollo avanzado con Flutter.\nDocker para orquestaci\xf3n de entornos.\nKubernetes (meta futura) para mejorar despliegues en producci\xf3n y escalabilidad."},
